        if b == 0:
            return a
        return gcd(b, a % b)
    flag = 0
    cur = A[0]
    for i in range(1, N):
        new = gcd(cur, A[i])
        if new == 1:
            if flag == 0:
                flag = 1
                r = i
                continue
            return -1
        cur = new
    if flag == 0:
        return (0, [])
    (A[r], A[-1]) = (A[-1], A[r])
