        (a, b) = (max(a, b), min(a, b))
        if b == 0:
            return a
        return gcd(b, a % b)
    flag = 0
    cur = A[0]
    for i in range(1, N):
        new = gcd(cur, A[i])
        if new == 1:
            if flag == 0:
                flag = 1
                r = i
                continue
            return -1
        cur = new
    if flag == 0:
        return (0, [])
    (A[r], A[-1]) = (A[-1], A[r])
    flag = 0
    cur = A[-1]
    l = 0
    for i in range(N - 2, -1, -1):
        g = gcd(A[i], cur)
        if g == 1:
            if flag == 0:
                flag = 0
                l = i
                continue
            return -1
        cur = g
    if l == 0 and r == N - 1:
        return (0, [])
    if l == 0:
        return (1, [(r + 1, N)])
    if r == N - 1:
        return (1, [(1, l + 1)])
    return (2, [(1, l + 1), (r + 1, N)])

